column26:
Открыто приложение Inctagramm

Открыта форма регистрации пользователя

Пользователь не зарегистрирован в системе

Шаги:

1. в поле Username ввести валидные данные; 

2. в поле Email ввести валидные данные; 

3. в поле Password ввести валидные данные;

Ожидаемый результат: система не отображает сообщение об ошибке, рамка поля окрашена в синий цвет.

Фактический результат: отображается ошибка "Password must contain 0-9, a-z, A-Z, and at least one special character", рамка поля окрашена в красный цвет

Окружение: Firefox. Google
